PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "android_metadata" (
 "locale"       TEXT DEFAULT 'en_US'
);
CREATE TABLE IF NOT EXISTS "taxon" (
	`id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`epithet`	TEXT NOT NULL,
	`rank`	INTEGER NOT NULL,
	`parent_id`	INTEGER,
	`accepted_id`	INTEGER,
	`authorship`	TEXT
);
COMMIT;
